import React, {Component} from 'react';
import '../../default.css';
class Homepage extends React.Component {
  render() {
    return(
        <div className="wrap">
            <div className="frontpage">
                <div>   
                    <h1>Society of Women Engineers</h1>
                    <h4>Aspiring. Advancing. Achieving</h4>
                </div>

            </div>
        </div>
    );
  }
}

export default Homepage;;
